
exports.seed = function(knex, Promise) {
  // Deletes ALL existing entries
  return knex.raw('DELETE FROM slice; ALTER SEQUENCE slice_id_seq RESTART WITH 3;')
    .then(function () {
      // Inserts seed entries
      return knex('slice').insert([
        {
          id: 1, imageURL:"data:image/jpeg;base64,", height: 40, width: 40, selected: true
        },
        {
          id: 2, imageURL:"data:image/jpeg;base64,", height: 40, width: 40, selected: true
        },
      ]);
    });
};
